i1 = Information.create!(hotel_id: h1.id, description: 'Ideally located on a white sandy stretch of Playa Mujeres, Garza Blanca Cancun offers exquisite experiences from the moment you step into the lobby, to the moment you check out from this heaven on earth. This luxurious resort in Cancun encompasses only the finest comforts, so you can live a classy oceanfront stay in the Mexican Caribbean.', amentity: 'All-Inclusive, Beach, Pool, Free-Transportation, Gym')
i2 = Information.create!(hotel_id: h2.id, description: 'Enjoy the ultimate all-inclusive vacation on Mexico’s Yucatan Peninsula with a stay at Wyndham Alltra Cancun. Situated in the heart of the lively Hotel Zone, our sprawling beachfront resort is the perfect escape for families, couples, and group gatherings. From the moment you arrive, you’ll be transported to paradise with more than 10 incredible restaurants, bars, and lounges, multiple pools, and a host of included activities ranging from yoga classes to tequila tastings.', amentity: 'All-Inclusive, Beach, Pool, Free-Transportation, Gym')
i3 = Information.create!(hotel_id: h3.id, description: 'Towering 42 stories over Chelsea, our hotel is two blocks from Madison Square Park and the Flatiron Building. We’re about a mile from The High Line, Chelsea Market, Times Square, and Greenwich Village. Dozens of unique eateries, bars, museums, and shops are also a short walk from our doors. Or unwind with a drink and bite to eat at our bar and restaurant.', amentity: 'Free-Wifi, Breakfast, Gym, Pool, Airport Shuttle, Free Parking')
i4 = Information.create!(hotel_id: h4.id, description: 'Please welcome to the stage New York City’s newest and brightest star, Hard Rock Hotel New York. Located between the Theatre District and Radio City Music Hall, our legendary lineup includes extraordinary entertainment venues, 446 guestrooms and suites across 36 floors, and innovative dining. Turn up the volume on the world’s most iconic skyline from RT60 rooftop bar and lounge. This is your backstage pass to the best of Midtown Manhattan with Broadway, Rockefeller Center, and Fifth Avenue shopping steps away.', amentity: 'Free-Wifi, Breakfast, Gym, Pool, Airport Shuttle, Free Parking')
i5 = Information.create!(hotel_id: h5.id, description: 'Grand Park Royal Cancún is an all inclusive resort located in Cancun. The beachfront resort offerss spacious oceanview rooms with private balconies and indulgent amenities. Our suites are carefully appointed for an elegant and exclusive atmosphere, ideal to live those great moments.', amentity: 'All-Inclusive, Beach, Pool, Free-Transportation, Gym')
i6 = Information.create!(hotel_id: h6.id, description: 'Discover the new and rejuvenated JW Marriott Cancun Resort & Spa which includes an extensive transformation to all 447 lavish ocean-facing guestrooms and suites. The hotel’s multi-million dollar restoration will provide the highest degree of luxury service, embracing its ideal beachfront location and introducing modern elements complemented by local Mayan flair.', amentity: 'All-Inclusive, Beach, Pool, Free-Transportation, Gym')
i7 = Information.create!(hotel_id: h7.id, description: 'The DoubleTree New York Downtown rises high above the Stone Street Historic District in lower Manhattan. Just blocks from the NYSE, Battery Park, and the South Street Seaport, our modern, high-rise hotel in the heart of the Wall Street / Downtown Financial District offers spectacular views of downtown Manhattan, Brooklyn, and Ellis Island. Enjoy upscale DoubleTree comfort and a great lower Manhattan hotel location equally convenient to Newark Liberty International, JFK, and LaGuardia Airports.', amentity: 'Free-Wifi, Breakfast, Gym, Pool, Airport Shuttle, Free Parking')
i8 = Information.create!(hotel_id: h8.id, description: 'Experience the stunning architecture of The Oculus and explore the One World Observatory and 9/11 Memorial Museum. A stay at Millennium Hotel New York Downtown places you in the heart of the Financial District with unobstructed panoramas of Lower Manhattan from our City View rooms. Select rooms also offer views of the Hudson River, the Freedom Tower, Manhattan Bridge and Brooklyn Bridge. Jump on the subway with 11 stops within a block of the property and enjoy ferry access just a 10 minute walk away.', amentity: 'Free-Wifi, Breakfast, Gym, Pool, Airport Shuttle, Free Parking')


